// ProtectedRoute.jsx
import React from 'react';
import { Route, Navigate } from 'react-router-dom';
import { isAuth } from './auth'; // Import your authentication function

const ProtectedRoute = ({ element: Component, ...rest }) => {
  const authed = isAuth(); // Determine if the user is authenticated

  // If authenticated, render the component, otherwise, navigate to the login page
  return authed ? <Route {...rest} element={<Component />} /> : <Navigate to="/patientlogin" />;
};

export default ProtectedRoute;
